description:
Dive into the Deep Blue Sea for treasure, adventure and fun in an underwater world! Get lost in the intriguing story of the aquatic people of Avalonia as you discover the scattered fragments of their Sacred Amulets. Collect the pieces of all seven Power Amulets to assist you in your journey through 130 breathtaking levels! Hit the dive shop for additional power-ups, larger chests to hold your treasure and more! Uncover the mystery of Avalonia today!

